import * as FaIcons from 'react-icons/fa';
import './arrow.css';

const Arrow = (props) => {

    return (
        <div className='arrow-container'>
            <a href={props.link} ><FaIcons.FaArrowCircleDown className='down-arrow'/></a>
        </div>
    )
}

export default Arrow
